export class user extends Component {
    componentDidMount() {
        this.props.getUser(this.props.match.params.login);
    }  

    render() {
        const {
            name,
            avatar_url,
            bio,
            location,
            blog,
            html_url,
            followers,
            public_repos,
            public_gists,
            hireable
        } = this.props.user;

        const { loading } = this.props;
        return <div>
               {name}
            </div>

    }
}

export default user
